六个质数中只有2是偶数，其余五个都是奇数。两个数的和为偶数的情况有以下几种：两个奇数相加，或者一个奇数和一个偶数相加。奇数相加有$5 \times 4 = 20$ 种情况，偶数相加有$5$ 种情况。总共有$6 \times 5 = 30$ 种情况，所以两个数的和为偶数的概率是$\frac{20 + 5}{30} = \frac{25}{30} = \boxed{\frac{5}{6}}$ 。

[asy]
size(100);
defaultpen(linewidth(0.7));
int[] primes = {2, 3, 5, 7, 11, 13};
int n = primes.length;
for (int i = 0; i < n; ++i) {
for (int j = i + 1; j < n; ++j) {
if (primes[i] + primes[j] % 2 == 0) {
label("$" + string(primes[i]) + " + " + string(primes[j]) + " = " + string(primes[i] + primes[j]) + "$", primes[i] + primes[j], dir(90));
}
}
}
[/asy]

矩形区域的边长为$10$，所以矩形区域内部的整点数为$9\times 8=72$。 但是，四个顶点处的点被计算了两次，所以最终答案为$72-4=\boxed{68}$。  [asy]
size(100);
defaultpen(linewidth(0.7));
int i;
for (i=0; i<=10; ++i) {
draw((i,0)--(i,4));
draw((0,i)--(10,i));
}
draw((0,0)--(10,4),dotted);
draw((0,4)--(10,0),dotted);
[/asy]

考虑圆的直径 $AB$。$CD$ 与 $AB$ 相交当且仅当 $C$ 和 $D$ 在 $AB$ 的两侧。$C$ 和 $D$ 在 $AB$ 的两侧的概率是 $\frac{1}{2}\times\frac{1}{2}=\frac{1}{4}$。$\boxed{\frac{1}{4}}$ 。

[asy]
size(100);
draw(Circle((0,0),1));
draw((-1,0)--(1,0));
draw((0,-1)--(0,1));
draw((0,0)--dir(100),dashed);
draw((0,0)--dir(200),dashed);
draw((0,0)--dir(300),dashed);
draw((0,0)--dir(400),dashed);
label("$A$",dir(0),E);
label("$B$",dir(180),W);
label("$C$",dir(100),NW);
label("$D$",dir(200),SW);
[/asy]

